pragma solidity ^0.8.0;

//SPDX-License-Identifier: MIT

contract ItemManager{

    enum SupplyChainSteps{Created, Paid, Delivered}

    struct S_Item{
        ItemManager.SupplyChainSteps _step;
        string identifier;
        uint priceInWei;
    }

    mapping (uint => S_Item) public items;
    uint index;

    event SupplyChainStep(uint _itemIndex, uint _step);

    function createItem(string memory _identifier, uint _priceInWei) public {
        S_Item memory newItem;
        newItem.identifier = _identifier;
        newItem.priceInWei = _priceInWei;
        newItem._step = SupplyChainSteps.Created;
        items[index] = newItem;
        emit SupplyChainStep(index, 0);
        index++;
    }

    function triggerPayment(uint _itemIndex) public payable {
        require(msg.value >= items[_itemIndex].priceInWei, "You do not have enough ether");
        require(items[_itemIndex]._step == SupplyChainSteps.Created, "Item is already paid");
        items[_itemIndex]._step = SupplyChainSteps.Paid;
        emit SupplyChainStep(_itemIndex, 1);
    }

    function triggerDelivery(uint _itemIndex) public {
        require(items[_itemIndex]._step == SupplyChainSteps.Paid, "Item not paid yet");
        
    }



}

